import React from "react";


function FooterLinks() {

  return (
    <footer class="navbar p-0 m-0 fixed-bottom navbar-expand-lg navbar-primary bg-primary text-center">
      <p class="navbar-brand m-auto"><small>&#169; Copyright 2020 Seychelle Koplik</small></p>
      <h3 style="text-align: end;"> Social: 
      <a href="http://www.github.com/seykoplik" target="_blank" class="fa fa-github"></a>
      <a href="http://linkedin.com/in/seykoplik" target="_blank" class="fa fa-linkedin"></a>
      <a href="http://www.instagram.com/seykoplik" target="_blank" class="fa fa-instagram"></a>
    </h3>
    </footer>
  );
}

export default FooterLinks;
